import React from "react";
import { UncontrolledCarousel } from "reactstrap";

const items = [
  {
    src: "/static/images/splash-1.jpg",
    altText: "Slide 1",
    caption: "Slide 1",
    header: "Slide 1 Header"
  },
  {
    src: "/static/images/splash-2.jpg",
    altText: "Slide 2",
    caption: "Slide 2",
    header: "Slide 2 Header"
  }
];

const Example = () => <UncontrolledCarousel className="splash" items={items} />;

export default Example;
